<script>
export default {
  data() {
    return {
      isDropdownVisible: true, //  true   
      isDropdownVisible2: true,
      isDropdownVisible3: true,
      triangleStyle: "translate(0, 0) scale(1, 1)",
      triangleStyle2: "translate(0, 0) scale(1, 1)",
      triangleStyle3: "translate(0, 0) scale(1, 1)"
    };
  },
  mounted() {
    this.resizeContent();
    window.addEventListener('resize', this.resizeContent);
  },
  beforeUnmount() {
    window.removeEventListener('resize', this.resizeContent);
  },
  methods: {
    resizeContent() {
      const content = this.$el.querySelector('.content');
      const app = this.$el;
      const scaleX = window.innerWidth / 1920;
      const scaleY = window.innerHeight / 1200;
      const scale = Math.min(scaleX, scaleY);

      content.style.transform = `scale(${scale})`;
      content.style.transformOrigin = 'top left';
      content.style.width = '1920px';
      content.style.height = '1200px';

      const left = (window.innerWidth - 1920 * scale) / 2;
      const top = (window.innerHeight - 1200 * scale) / 2;

      content.style.position = 'absolute';
      content.style.left = `${left}px`;
      content.style.top = `${top}px`;

      app.style.width = `${window.innerWidth}px`;
      app.style.height = `${window.innerHeight}px`;
    },
    toggleDropdown() {
      //  id  
      const elementIds = ['pos5', 'pos6', 'pos7', 'pos8'];
      //      
      const movement = this.isDropdownVisible ? -348 : 0;

      //    
      elementIds.forEach(id => {
        const element = document.getElementById(id);
        if (element) {
          element.style.transition = 'transform 0.3s ease-in-out'; //    
          element.style.transform = `translateY(${movement}px)`; // Y 
        }
      });

      if(this.isDropdownVisible) {

        this.triangleStyle = "translate(0, 64) scale(1, -1)";
      }
      else {

        this.triangleStyle = "translate(0, 0) scale(1, 1)";
      }

      //    
      this.isDropdownVisible = !this.isDropdownVisible;
    },
    toggleDropdown2() {
  const elementIds = ['pos7', 'pos8'];

  elementIds.forEach(id => {
    const element = document.getElementById(id);
    if (element) {
      //  transform  
      const currentTransform = element.style.transform;

      //  Y    
      let currentY = 0; //  Y  
      const match = currentTransform.match(/translateY\(([-\d]+)px\)/);
      if (match) {
        currentY = parseInt(match[1]); //   
      }

      //  Y  
      const newY = this.isDropdownVisible2 ? currentY - 240 : currentY + 240;

      //       
      element.style.transition = 'transform 0.3s ease-in-out';
      element.style.transform = `translateY(${newY}px)`;
    }
  });

  //   
  this.isDropdownVisible2 = !this.isDropdownVisible2;
},
toggleDropdown3() {
  //    pos8   
  const movement = this.isDropdownVisible3 ? -20 : 0;  //     -20,    -120

  // pos8  
  const element = document.getElementById('pos8');
  if (element) {
    //    
    element.style.transition = 'transform 0.3s ease-in-out';
    // translateY    
    element.style.transform = `translateY(${movement}px)`;
  }

  //    
  this.isDropdownVisible3 = !this.isDropdownVisible3;
}
,
  },
};
</script>

